/*
5293. Maximum Number of Occurrences of a Substring
Difficulty:Medium
Given a string s, return the maximum number of ocurrences of any substring under the following rules:

The number of unique characters in the substring must be less than or equal to maxLetters.
The substring size must be between minSize and maxSize inclusive.
*/

import java.util.HashMap;

public class Solution {

    public int maxFreq(String s, int maxLetters, int minSize, int maxSize) {
        int maxNumStr = 0;
        
        HashMap<String, Integer> map = new HashMap<String, Integer>();
        int len = s.length();
        for (int i = 0; i < len; ++i) {
            if (i+minSize > len) {
                break;
            }

            String subStr = s.substring(i, i+minSize);
            if (map.containsKey(subStr)) {
                Integer count = map.get(subStr);
                map.put(subStr, ++count);

                if (count > maxNumStr) {
                    maxNumStr = count;
                }
            } else {
                // check max letters
                int sublen = subStr.length();
                int max = 0;
                boolean[] hasLetter = new boolean[26];
                for (int j = 0; j < sublen; ++j) {
                    int c = subStr.charAt(j) - 'a';
                    if (!hasLetter[c]) {
                        max++;
                        hasLetter[c] = true;

                        if (max > maxLetters) {
                            break;
                        }
                    }
                }

                if (max > maxLetters) {
                    continue;
                }

                map.put(subStr, 1);
                if (maxNumStr == 0) {
                    maxNumStr = 1;
                }
            }
        }
        
        return maxNumStr;
    }
  
    public static void test(String str, int maxLetters, int minSize, int maxSize, int expected) {
        Solution s = new Solution();
        // long ts = System.nanoTime();
        int ret = s.maxFreq(str, maxLetters, minSize, maxSize);
        // System.out.println(System.nanoTime() - ts);
        if (ret == expected) {
            System.out.println("Passed");
        } else {
            System.out.println("Excepted: " + expected + " Failed: " + ret);
        }
    }

    public static void main(String[] args) {
        test("bccaabac", 2, 2, 2, 1);
        test("aababcaab", 2, 3, 4, 2);
        test("aaaa", 1, 3, 3, 2);
        test("aabcabcab", 2, 2, 3, 3);
        test("abcde", 2, 3, 3, 0);
        test("", 3, 5, 26, 18);
        String str1 = "";
        String str2 = "";
        test(str1 + str2, 7, 4, 23, 20);
    }
}
